-- Tags: long

SELECT 'Trivial case';

SELECT multi_if(true, 2, true, 3, 4);
SELECT multi_if(true, 'A', true, 'BC', 'DEF');
SELECT multi_if(true, to_fixed_string('A', 16), true, to_fixed_string('BC', 16), to_fixed_string('DEF', 16));
SELECT multi_if(true, [1,2], true, [3,4], [5,6]);
SELECT multi_if(true, ['A', 'B'], true, ['C', 'D'], ['E', 'F']);
SELECT multi_if(rand() % 2 = 0, empty_array_string(), empty_array_string());
SELECT multi_if(rand() % 2 = 0, empty_array_uint8(), empty_array_uint8());
SELECT multi_if(rand() % 2 = 0, '', '');

